import React from "react";
import { Col, Row } from "react-bootstrap";

const CartItems=(props)=>{

    return(
        <li>
            
            <Row xs={3}>
                <Col>{props.title}</Col>
                <Col>{props.price}</Col>
                <Col>Quantity</Col>
            </Row>
        </li>
    )
}

export default CartItems
